import {Box, Heading, HStack, VStack} from "@chakra-ui/react";

const Assignment = () => {
    return (
        <Box w={'100%'} minH={'100vh'}>
            <VStack w={'100%'} spacing={2}>
                <HStack w={'100%'}>

                </HStack>
            </VStack>
        </Box>
    );
};

export default Assignment;
